[{"location":"IsothermData/#IsothermData","page":"Isotherm Data","title":"IsothermData","text":"","category":"section"},{"location":"IsothermData/","page":"Isotherm Data","title":"Isotherm Data","text":"An IsothermData is the core structure that holds all information needed for isotherms, or really any collection of chemical data that catalogs some property (e.g., concentration, density), as a function of a potential (e.g., pressure, activity, fugacity, chemical potential, etc.) ","category":"page"},{"location":"IsothermData/","page":"Isotherm Data","title":"Isotherm Data","text":"IsothermData","category":"page"},{"location":"IsothermData/#MembraneBase.IsothermData","page":"Isotherm Data","title":"MembraneBase.IsothermData","text":"IsothermData(; \n    partial_pressures_mpa=nothing, concentrations_cc=nothing, activities=nothing, temperature_k=nothing, \n    rho_pol_g_cm3=nothing, pen_mws_g_mol=nothing,\n)\n\nContainer for all data relevant to isotherms.\n\nData specific to each component and step are organized in matrix format with columns representing components and rows representing steps i.e., with s -> step and c -> component:\n\n    [ s1c1  s1c2  s1c3 ...\n      s2c1  s2c2  s2c3 ...\n      s3c1  s3c2  s3c3 ...\n      ...   ...   ...  ... ]\n\nInputs\n\nInputs can be vectors of vectors e.g., partial_pressures_mpa = [[component_1-step_1, component_1-step_2, ...], [component_2-step_1, component_2-step_2, ...], ...] Or, if only one component is present, only a vector e.g., [step_1, step_2, ...]\n\n\n\n\n\n","category":"type"},{"location":"TransientStepData/#TransientStepData","page":"Transient Step Data","title":"TransientStepData","text":"","category":"section"},{"location":"TransientStepData/#*What-is-it?*","page":"Transient Step Data","title":"What is it?","text":"","category":"section"},{"location":"TransientStepData/","page":"Transient Step Data","title":"Transient Step Data","text":"TransientStepData objects hold information pertaining to transient sorption steps. This is dimensionless data that describes the transition from one equilibrium to another (e.g., concentration, dilation, etc) as a function of time. ","category":"page"},{"location":"TransientStepData/#*How-do-I-make-one?*","page":"Transient Step Data","title":"How do I make one?","text":"","category":"section"},{"location":"TransientStepData/","page":"Transient Step Data","title":"Transient Step Data","text":"TransientStepData","category":"page"},{"location":"TransientStepData/#MembraneBase.TransientStepData","page":"Transient Step Data","title":"MembraneBase.TransientStepData","text":"TransientStepData(dataset)\n\nContainer for data concerning a single transient sorption step. I.e., a profile of mass concentration with time (starting from a previous equilibrium and generally reaching a new equilibrium) of some penetrant into an even film of polymer material, or more succinctly, a polymer slab. \n\nArguments\n\ndataset: Should be some iterable with \nthe first item being an iterable of time data (in seconds)\nthe second item being an iterable of dimensionless sorption data (no units)  \n\n\n\n\n\n","category":"type"},{"location":"TransientStepData/","page":"Transient Step Data","title":"Transient Step Data","text":"A number of functions exist to make your life easier with handling this data. ","category":"page"},{"location":"TransientStepData/","page":"Transient Step Data","title":"Transient Step Data","text":"resample(::TransientStepData, ::Any, ::Any)\r\ndataset(transient::TransientStepData)\r\nstrip_measurement_to_value(meas::TransientStepData)","category":"page"},{"location":"TransientStepData/#MembraneBase.resample-Tuple{TransientStepData, Any, Any}","page":"Transient Step Data","title":"MembraneBase.resample","text":"resample(transient::TransientStepData, num_datapoints, time_function)\n\nResample the data with some time_function spacing and linear interpolation between adjacent data points. Use this method when you have a ridiculous amount of data and need to slim it down while losing as little valuable information as possible.\n\nArguments\n\ntransient::TransientStepData: TransientStepData used to resample\nnum_datapoints::Integer: number of resampled data points to be in the resulting TransientStepData (should always be less than what you currently have)\ntime_function::Symbol: how to weigh the time data...\n:Linear will have even spacing from t=0 to t=num_datapoints\n:Root will sample along the root of time (more information about the initial behavior will be kept)\nIt is usually best to use :Root for most scenarios and :Linear for quick scenarios\n:Log will sample along the log_10 of time (much more info about initial behavior will be kept)\nReserve Log for extremely long timescales (think: on the order of months or years, not days or weeks)\n\nThis function assumes that time data is sorted in ascending order\n\n\n\n\n\n","category":"method"},{"location":"TransientStepData/#MembraneBase.dataset-Tuple{TransientStepData}","page":"Transient Step Data","title":"MembraneBase.dataset","text":"Get a Vector of data in the transient step in form of [(time, sorption)...]. Used primarily for bootstrap-like resampling techniques.\n\n\n\n\n\n","category":"method"},{"location":"TransientStepData/#MembraneBase.strip_measurement_to_value-Tuple{TransientStepData}","page":"Transient Step Data","title":"MembraneBase.strip_measurement_to_value","text":"Return a copy of the data with no Measurement data types present.\n\n\n\n\n\n","category":"method"},{"location":"#MembraneBase.jl-Documentation","page":"Home","title":"MembraneBase.jl Documentation","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"This package contains most of the shared functions and structures used in the MembranePackages ecosystem.","category":"page"},{"location":"","page":"Home","title":"Home","text":"","category":"page"},{"location":"#Data-Types","page":"Home","title":"Data Types","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"Isotherm Organization: IsothermData","category":"page"},{"location":"","page":"Home","title":"Home","text":"Tranient Data: TransientStepData","category":"page"},{"location":"#Statistical-Analysis","page":"Home","title":"Statistical Analysis","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"Coming soon!","category":"page"}]
